import React, {useContext, useEffect, useState} from 'react';

const Products: React.FC = () => {
    const[products, setProducts] = useState([]);
    return (
        <div>
            <h1>Products</h1>
            {products.map((product) => {(
                <p>Product id : {product.id}</p>
                )}
            )}
        </div>
    )
}

export default Products;
